DROP TABLE IF EXISTS `messagestatus`;
CREATE TABLE `messagestatus` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `send_id` varchar(300) DEFAULT NULL COMMENT '消息发送ID',
  `sendTime` varchar(50) DEFAULT NULL COMMENT '请求时间:yyyyMMddHHmmss',
  `receptionUrl` varchar(100) DEFAULT NULL COMMENT '消息接收方URL',
  `backUrl` varchar(100) DEFAULT NULL COMMENT '消息回复方URL',
  `dataContent` varchar(500) DEFAULT NULL COMMENT '消息内容（JSON格式）',
  `headerContent` varchar(500) DEFAULT NULL COMMENT '送给消息接收方的HTTP请求头设置（JSON格式），如果为null或空字符串则使用默认请求头',
  `reqSucessMatch` varchar(500) DEFAULT NULL COMMENT '请求成功结果效验',
  `keyVersion` varchar(10) DEFAULT NULL COMMENT '业务消息发送方RSA私钥序号',
  `signSendSender` text COMMENT '请求业务消息发送方RSA私钥签名字符串',
  `totalNum` int(11) DEFAULT NULL COMMENT '预定义消息重试次数',
  `totalBackNum` int(11) DEFAULT NULL COMMENT '预定义消息回复重试次数',
  `requestMode` int(11) DEFAULT NULL COMMENT '请求消息接收方的请求方式 1:postJson(默认)、2:postForm、3:getJson',
  `recode_request` int(11) DEFAULT NULL COMMENT '消息发送方请求消息服务状态码',
  `remessage_request` varchar(300) DEFAULT NULL COMMENT '消息发送方请求消息服务描述信息',
  `recontent_request` varchar(200) DEFAULT NULL COMMENT '消息发送方请求消息服务内容',
  `signSendMq_request` text COMMENT '消息发送方请求消息服务，消息服务返回加签',
  `againTime` varchar(50) DEFAULT NULL COMMENT '消息发送重试开始时间',
  `currentNum` int(11) DEFAULT NULL COMMENT '当前重试次数',
  `delay_value` bigint(20) DEFAULT NULL COMMENT '发送消息重试延迟时间(毫秒)',
  `recode_one` int(11) DEFAULT NULL COMMENT '首次入队返回状态码',
  `remessage_one` varchar(300) DEFAULT NULL COMMENT '首次入队返回描述信息',
  `recontent_one` varchar(200) DEFAULT NULL COMMENT '首次入队返回内容',
  `recode_again` int(11) DEFAULT NULL COMMENT '重试入队返回状态码',
  `remessage_again` varchar(300) DEFAULT NULL COMMENT '重试入队返回描述信息',
  `recontent_again` varchar(200) DEFAULT NULL COMMENT '重试入队返回内容',
  `backTime` varchar(50) DEFAULT NULL COMMENT '首次回复消息时间',
  `backAgainTime` varchar(50) DEFAULT NULL COMMENT '回复消息重试时间',
  `currentBackNum` int(11) DEFAULT NULL COMMENT '当前回复重试次数',
  `delayBack_value` bigint(20) DEFAULT NULL COMMENT '回复消息重试延迟时间(毫秒)',
  `recode_back` int(11) DEFAULT NULL COMMENT '回复首次入队返回状态码',
  `remessage_back` varchar(300) DEFAULT NULL COMMENT '回复首次入队返回描述信息',
  `recontent_back` varchar(200) DEFAULT NULL COMMENT '回复首次入队返回内容',
  `signBackSender_back` text COMMENT '回复消息，业务消息发送方RSA私钥加签',
  `recode_back_again` int(11) DEFAULT NULL COMMENT '回复重试入队返回状态码',
  `remessage_back_again` varchar(300) DEFAULT NULL COMMENT '回复重试入队返回描述信息',
  `recontent_back_again` varchar(200) DEFAULT NULL COMMENT '回复重试入队返回内容',
  `signBackSender_back_again` text COMMENT '回复消息重试，业务消息发送方RSA私钥加签',
  `endTime` varchar(50) DEFAULT NULL COMMENT '结束时间',
  `current_stage` int(11) DEFAULT NULL COMMENT '1:首次发送阶段，2:重试阶段，3:首次回复阶段，4:重试回复阶段',
  `process_end_send` int(11) DEFAULT NULL COMMENT '消息发送：1:未结束，2:成功结束，3:失败结束',
  `process_end_back` int(11) DEFAULT NULL COMMENT '消息回复：1:未结束，2:成功结束，3:失败结束',
  `updateTime` varchar(50) DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3640 DEFAULT CHARSET=utf8;

